import React, { useState } from 'react';
import { Range } from 'react-range-slider';

const TimelineSlider: React.FC<{ videoDuration: number, onTrimChange: (start: number, end: number) => void }> = ({ videoDuration, onTrimChange }) => {
  const [values, setValues] = useState([0, videoDuration]);

  const handleChange = (values: number[]) => {
    setValues(values);
    onTrimChange(values[0], values[1]);
  };

  return (
    <div className="timeline-slider">
      <Range 
        min={0} 
        max={videoDuration} 
        values={values} 
        onChange={handleChange} 
        renderTrack={({ props, children }) => (
          <div {...props} className="track">
            {children}
          </div>
        )}
        renderThumb={({ props }) => (
          <div {...props} className="thumb" />
        )}
      />
    </div>
  );
};

export default TimelineSlider;
